            </div>
        </div>
    );
};
export default Course;
const [course, setCourse] = useState([]);

useEffect(() => { oneCourse() }, []);

const oneCourse = (i) => {
    axios.get(`http://localhost:5000/students/details/${i}`)
        .then((res) => {
            console.log('oneCourse :', res.data)
            setCourse(res.data);
        })
        .catch((err) => {
            console.log('ERR: ', err);
        })
};
